// src/components/Courses/Courses.js
import React from 'react';
import CourseCard from './CourseCard';

const Courses = () => {
  // Example course data (can be fetched from API)
  const courses = [
    { id: 1, title: 'React Basics', description: 'Learn the basics of React.' },
    { id: 2, title: 'Advanced JavaScript', description: 'Deep dive into JavaScript.' },
    // More courses...
  ];

  return (
    <div className="courses">
      <h1>Explore Our Courses</h1>
      <div className="course-list">
        {courses.map(course => (
          <CourseCard key={course.id} course={course} />
        ))}
      </div>
    </div>
  );
};

export default Courses;
